INSERT INTO `pages` VALUES (1,'Scheduling Text','You have successfully registered for New Student Orientation on {{ registration.orientation.friendly_date }} at {{ registration.orientation.class_time}}. You will need to bring a pen or pencil to the New Student Orientation.  Please arrive 10 minutes prior to your scheduled Orientation.  Remember, you must attend this Orientation session before you may register for classes. </p> <p> LOCATION Your two hour, lab-based New Student Orientation will be held in {{ registration.orientation.location}} <p> A Campus Map is available at www.abtech.edu/content/a-b-tech-locations/asheville-campus. </p> <p> Parking can be tight while classes are in session, so give yourself extra time to find parking and walk to {{ registration.orientation.location}}. Park in white lined spaces only! </p> <p> Please refrain from bringing food and beverages into the Orientation Room. Guests are not allowed in the New Student Orientation room. </p> <p> To schedule an optional campus tour, please visit newstudents.abtech.edu/campus_tour/ If you cannot attend your scheduled session, please go back into this page and \"destroy\" your scheduled time. You will click on the \"Destroy\" button in the right hand column and it will take you out of the session. Thank You!','2014-05-05 19:44:51','2014-07-30 19:39:04'),(2,'Scheduling Email','You have successfully registered for New Student Orientation on {{ registration.orientation.friendly_date }} at {{ registration.orientation.class_time }}. You will need to bring a pen or pencil to the New Student Orientation.  Please arrive 10 minutes prior to your scheduled Orientation. Please remember, you must attend this Orientation session before you may register for classes. LOCATION Your two hour, lab-based New Student Orientation will be held in {{ registration.orientation.location}}. For a Campus Map, please visit www.abtech.edu/content/a-b-tech-locations/asheville-campus. Parking can be tight while classes are in session, so give yourself extra time to find parking and walk to {{ registration.orientation.location}}. Park in white lined spaces only! Please refrain from bringing food and beverages into the Orientation Room. Guests are not allowed in the New Student Orientation room. To schedule an optional campus tour, please visit newstudents.abtech.edu/campus_tour/ If you cannot attend your scheduled session, please go back into this page and \"destroy\" your scheduled time. You will click on the \"Destroy\" button in the right hand column and it will take you out of the session. Thank You! ','2014-05-05 19:44:51','2014-07-30 19:40:28'),(3,'Online Registration Text','Congratulations! You have successfully registered for the online New Student Orientation (NSO), which is offered through Moodle. Your Moodle account will be created within 4-6 hours and your course will be available. Once your account has been created, you can begin the orientation. You will need to: Login to moodle.abtech.edu, under \"My Courses\" go to \"NSO.\" Your username is: first name, middle initial, last name (johnqstudent). Your password is the same as your WebAdvisor password, which is initially your birth date in MMDDYY format. If you are unable to login, contact the Helpdesk at helpdesk@abtech.edu or (828) 398-7550. If you are new to Moodle, a video tour is available at moodle.abtech.edu. ALL students are required to successfully complete New Student Orientation (NSO) before registering for classes. Successful completion requires passing the Assessment at the end of the course with an 80% or higher. Beginning August 1st, as part of your online New Student Orientation, you must complete the SmarterMeasure Online Readiness Assessment.  This assessment can be found at the bottom of your NSO Moodle page and will need to be completed before you register for classes at A-B Tech. Assessments are uploaded and registration restrictions are lifted on weekdays at 9 AM, 12 PM, 3 PM and 6 PM. Please be sure to plan ahead!','2014-05-05 19:44:51','2014-08-01 20:19:42'),(4,'Online Registration Email','Congratulations! You have successfully registered for the online New Student Orientation (NSO), which is offered through Moodle. Your Moodle account will be created within 4-6 hours and your course will be available. Once your account has been created, you can begin the orientation. You will need to: Login to moodle.abtech.edu, under \"My Courses\" go to \"NSO.\" Your username is: first name, middle initial, last name (johnqstudent). Your password is the same as your WebAdvisor password, which is initially your birth date in MMDDYY format. If you are unable to login, contact the Helpdesk at helpdesk@abtech.edu or (828) 398-7550. If you are new to Moodle, a video tour is available at moodle.abtech.edu. ALL students are required to successfully complete New Student Orientation (NSO) before registering for classes. Successful completion requires passing the Assessment at the end of the course with an 80% or higher.  Beginning August 1st, as part of your online New Student Orientation, you must complete the SmarterMeasure Online Readiness Assessment.  This assessment can be found at the bottom of your NSO Moodle page and will need to be completed before you register for classes at A-B Tech. Assessments are uploaded and registration restrictions are lifted on weekdays at 9 AM, 12 PM, 3 PM and 6 PM. Please be sure to plan ahead!','2014-05-05 19:44:51','2014-08-01 20:20:14'),(5,'Cancel Confirmation Email','This is a verification that you want to cancel your scheduled A-B Tech New Student Orientation session for {{ registration.orientation.friendly_date }}  at {{ registration.orientation.class_time}}. If you do not want to cancel your scheduled orientation, ignore this email. Please be advised, that you will need to reschedule and attend orientation before you may register for classes. If you wish to proceed with canceling your current orientation session, click the Destroy Registration link below.','2014-05-05 19:44:51','2014-05-05 19:44:51'),(6,'Cancel Confirmation Text','You have successfully cancelled your registration for the A-B Tech New Student Orientation session scheduled for {{ registration.orientation.friendly_date }}  at {{ registration.orientation.class_time}}. You will need to reschedule and attend orientation before you may register for classes. To reschedule go to www.abtech.edu/nso.','2014-05-05 19:44:51','2014-05-21 18:06:51'),(7,'Reminder Email','Hello {{ registration.first_name }}. This is a reminder that you are scheduled to attend the A-B Tech New Student Orientation on {{ registration.orientation.friendly_date }} at {{ registration.orientation.class_time }}. <p> You will need to bring a pen or pencil to the New Student Orientation.  Please arrive 10 minutes prior to your scheduled Orientation. Please remember, you must attend this Orientation session before you may register for classes. <p> LOCATION <p> Your two-hour, lab-based New Student Orientation will be held in {{ registration.orientation.location}} <p> For a Campus Map, please visit www.abtech.edu/content/a-b-tech-locations/asheville-campus. <p> Parking can be tight while classes are in session, so give yourself extra time to find parking and walk to {{ registration.orientation.location}}. Park in white lined spaces only! <p> Please refrain from bringing food and beverages into the Orientation Room. Guests are not allowed in the New Student Orientation room. <p> To schedule an optional campus tour, please visit abtech.edu/campus_tour/ <p> We look forward to seeing you! ','2014-05-05 19:44:51','2014-07-30 19:41:58');
